import React, { useEffect, useState } from "react";
import { SPE1Questions, SPE2Questions } from '../js/list'
import Card from "./Card";

function Content() {
// const [login, setLogin] = useState(false);
// const [data, setData] = useState({username:'', role:''});


  return (
    <div className="flex flex-[80] h-screen justify-center">
      <div className="flex items-center flex-col ">
          <h1>Self and Peer Evaluation 1</h1>
          <div className=" p-8 flex flex-col items-center border-black-100 border-2 overflow-auto">
            <form action="" className="w-full" method="post" enctype="multipart/form-data" id="myForm1">
              <div id="SPEContainer" className="flex flex-col items-center">
                <div id="cards" className="">
                  {/* <!-- client.js line 132: $("#cards").html(SPEQuestions.join('')); inserted here --> */}
                  {
                    SPE1Questions.map((question) => {
                      return        
                          <Card question={question.question}/>
                                  
                    })
                  }
                </div>                  
              
                <button type="submit" className="relative inline-flex items-center px-8 py-3 overflow-hidden text-white bg-indigo-600 rounded group active:bg-indigo-500 focus:outline-none focus:ring">
                  <span className="absolute right-0 transition-transform translate-x-full group-hover:-translate-x-4">
                    <svg className="w-5 h-5" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M17 8l4 4m0 0l-4 4m4-4H3" />
                    </svg>
                  </span>
                  <span className="text-sm font-medium transition-all group-hover:mr-4">
                    Submit
                  </span>
                </button>
              </div>
            </form>
          </div>
            
        </div>
    </div>
  );
}

export default Content;
